sources.main.css:
* {margin: 0; padding: 0;}
li {list-style: none;}
a {color: black; text-decoration: none;}
img {display: block;}

* {font-family: 'Spoqa Han Sans Neo', 'Spoqa Han Sans JP', sans-serif;}

html, body {
    font-size: 62.5%;
}

@media all and (min-width:320px) and (max-width:600px) {
    
    body {font-size: 1.4rem;}

    #chk_floating, #chk_popupbanner {display: none;}

    .floating_banner, .popup_banner {display: none;}

    .outer_header .inner_header .header .gnb,
    .outer_header .inner_header .header .header_box .search_text_box {display: none;}

    .visual_main .swiper-pagination-bullet {display: none;}
    
    .program .swiper-button-prev::after,
    .program .swiper-button-next::after {display: none;} 

    .program .swiper-button-prev,
    .program .swiper-button-next {display: none;}

    .outer_header {
        width: 100%;
        height: 45px;
        background-color: white;
    }
    .outer_header .inner_header {
        width: 100%;
    }
    .outer_header .inner_header .header {
        width: 100%;
        line-height: 45px;
    }
    .outer_header .inner_header .header .logo {
        width: 165px;
        height: 45px;
    }
    .outer_header .inner_header .header .logo img {
        width: 100%;
        height: 36px;
        padding-top: 4px;
    }
    .outer_header .inner_header .header .mob_gnb {
        width: 80px;
        height: 45px;
        position: absolute;
        top: 0;
        right: 30px;
        display: flex;
    }
    .outer_header .inner_header .header .mob_gnb>span {
        height: 45px;
        padding: 0 4px;
    }
    .outer_header .inner_header .header .mob_gnb>span>a {
        font-size: 1.7rem;
    }
    .outer_header .inner_header .header .mob_gnb>span:last-child>a img {
        width: 16px;
        height: 16px;
        padding-top: 14px;
        padding-left: 1px;
    }
    .outer_header .inner_header .header .mob_bar {
        width: 30px;
        height: 45px;
        position: absolute;
        top: 0;
        right: 0;
        font-size: 1.7rem;
    }

    .outer_header .inner_header .header .hide_sub {
        width: 80%;
        height: 100vh;
        background-color: white;
        position: relative;
        position: fixed;
        top: 0;
        right: -100%;
        transition: all 0.5s;

        z-index: 3;
    }
    .outer_header .inner_header .header .hide_sub.active {
        right: 0;
    }
    .outer_header .inner_header .header .hide_sub .sub {
        display: flex;
        flex-wrap: wrap;
        width: 100%;
        border-bottom: 1px solid #eee;
        box-sizing: border-box;
    }
    .outer_header .inner_header .header .hide_sub .sub_box {
        width: 100%;
        height: 45px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_logo {
        width: 165px;
        height: 45px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_logo img {
        width: 100%;
        height: 36px;
        padding-top: 4px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_close_btn {
        position: absolute;
        top: 0px;
        right: 16px;
        font-size: 1.9rem;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb {
        display: flex;
        width: 100%;
        height: 40px;
        border-top: 1px solid #eee;
        border-bottom: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div {
        width: 25%;
        height: 40px;
        line-height: 40px;
        text-align: center;
        border-left: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div:first-child {
        border-left: none;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div:nth-child(2) {
        width: 25.5%;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box {
        display: flex;
        width: 100%;
        height: 40px;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box>div {
        width: 50%;
        height: 40px;
        line-height: 40px;
        text-align: center;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box>div:first-child {
        border-right: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box .sub_sns {
        font-size: 1.7rem;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box .sub_sns>span:nth-child(2) {
        padding: 0 15px;
    }

    .outer_header .inner_header .header .hide_sub .lnb>li {
        width: 100%;
        position: relative;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>a {
        display: block;
        width: 100%;
        height: 40px;
        line-height: 40px;
        background-color: white;
        padding-left: 15px;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>a>i {
        position: absolute;
        top: 10px;
        right: 15px;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>ul {
        display: none;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>ul>li>a {
        display: block;
        width: 100%;
        height: 40px;
        line-height: 40px;
        background-color: #eee;
        padding-left: 15px;
        font-size: 1.2rem;
    }
    .outer_header .inner_header .header .lnb>li>ul>li>a>span i {
        padding-left: 3px;
        color: rgb(255, 48, 117);
    }
    .outer_header .inner_header .header .hide_back {
        display: none;
        width: 100%;
        height: 100vh;
        background-color: rgba(0, 0, 0, 0.7);

        position: fixed;
        top: 0;

        z-index: 2;
    }

    


    .visual_main {
        width: 100%;
        height: 370px;
        overflow: hidden;
    }
    .visual_main .visualswiper {
        width:100%;
        height: 370px;
        position: relative;
    }
    .visual_main .visualswiper .swiper-slide {
        width: 100%;
        height: 370px;
        text-align: center;
        border-radius: 10px;
    }
    .visual_main .visualswiper .swiper-slide img {
        width: 100%;
        height: 370px;
    }
    .visual_main .visualswiper .custom_box {
        position: absolute;
        bottom: 3px;
        right: 55px;
    }
    .visual_main .visualswiper .custom_box .pagination_custom {
        color: white;
        width: 45px;
        height: 30px;
        background-color: rgba(0, 0, 0, 0.2);
        border-radius: 15px;
        text-align: center;
        line-height: 30px;

        z-index: 1;
    }

    .visual_main .pagination_thumb {display: none;}



    .metaphor .on {display: none;}

    .metaphor {
        display: flex;
        flex-wrap: wrap;
        margin: 35px 15px;
    }
    .metaphor>section {
        display: flex;
        width: 100%;
        height: auto;
    }
    .metaphor>section:first-child {
        margin-bottom: 15px;
    }
    .metaphor>section>div {
        width: 50%;
        text-align: center;
    }
    .metaphor>section>div>a>div {
        width: 50%;
        margin: auto;
        margin-bottom: 7px;
    }
    .metaphor>section>div>a>div img {
        width: 100%;
    }





    .list_box {
        height: auto;
        margin: 0 15px;
        margin-bottom: 45px;
        position: relative;
        border: 1px solid #eee;
        box-sizing: border-box;
    }
    .list_title {
        width: 100%;
        height: 40px;
        line-height: 40px;
        text-align: center;
        font-size: 1.6rem;
        margin-top: 50px;
    }
    .list_box .week_list {
        height: 290px;
        position: relative;
    }
    .list_box .week_list .more_btn {
        width: 70px;
        height: 25px;
        line-height: 25px;
        text-align: center;
        position: absolute;
        left: 50%;
        margin-left: -35px;
        bottom: 0;
    }
    .list_box .no_btn {
        width: 100%;
        height: 25px;
        line-height: 25px;
        text-align: center;
        display: none;
    }

    .list_box .week_list .week_title {
        height: 40px;
        line-height: 40px;
        background-color: #2e3192;
        text-align: center;
        color: white;
        font-size: 1.5rem;
        font-weight: bold;
    }
    .list_box .week_list .week_title li {display: none;}
    .list_box .week_list .week_title li:first-child {display: block;}

    .list_box .week_list .list_sheet {
        height: 240px;
        margin:0 auto;
        padding:0;
        overflow: hidden;
    }
    .list_box .week_list .list_sheet li {
        height: 290px;
        padding: 15px 15px;
        display:none;
    }
    .list_box .week_list .list_sheet li:first-child {
        display:block;
    }

    .list_box .week_list .list_sheet>li>div>div>p {
        width: 100%;
        height: 35px;
        line-height: 35px;
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
    }
    .list_box .week_list .list_sheet>li>div>div>p img {
        display: inline-block;
        width: 15px;
        height: 15px;
    }
    .list_box .week_list .list_sheet .list_box02 {display: none;}

    .list_box .list_sheet_second {
        height: 240px;
        margin:0 auto;
        padding:0;
        display: none;
        position: relative;
    }
    .list_box .list_sheet_second li {
        height: 240px;
        padding: 15px 15px;
        display: none;
    }
    .list_box .list_sheet_second>li:first-child {
        display:block;
    }
    .list_box .list_sheet_second>li>div>div>p {
        width: 100%;
        height: 35px;
        line-height: 35px;
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
    }
    .list_box .list_sheet_second>li>div>div>p img {
        display: inline-block;
        width: 15px;
        height: 15px;
    }
    .list_box .list_sheet_second .list_box02 {display: none;}

    .list_box .week_list .libtn i {color: white; font-size: 1.5rem;}
    .list_box .week_list .list_btn_left {
        position: absolute;
        top: 10px;
        left: 10px;
        cursor: pointer;
    }
    .list_box .week_list .list_btn_right {
        position: absolute;
        top: 10px;
        right: 10px;
        cursor: pointer;
    }

    .movie_list, .month_calendar {display: none;}




    .trailer {
        height: auto;
        background-color: #dcf0f1;
        margin: 60px 0;
    }
    .trailer video {
        width: 100%;
        height: auto;
        margin-top: 30px;
    }
    .trailer .trailer_txt {
        margin: 0 15px;
        padding-top: 10px;
        padding-bottom: 20px;
    }
    .trailer .trailer_txt p:first-child {
        color: #2e3192;
        margin-bottom: 5px;
    }
    .trailer .trailer_txt p:nth-child(2) {
        margin-bottom: 5px;
    }




    #pro_tab01, #pro_tab02, #pro_tab03 {display: none;}

    #pro_tab01:checked ~ .program .program_sheet_box .movie_sheet {display: flex;}
    #pro_tab02:checked ~ .program .program_sheet_box .show_sheet {display: flex;}
    #pro_tab03:checked ~ .program .program_sheet_box .event_sheet {display: flex;}

    #pro_tab01:checked ~ .program .program_label .pro_tab01 {border: none; background-color: #2e3192; color: white;}
    #pro_tab02:checked ~ .program .program_label .pro_tab02 {border: none; background-color: #2e3192; color: white;}
    #pro_tab03:checked ~ .program .program_label .pro_tab03 {border: none; background-color: #2e3192; color: white;}

    .program .program_sheet_box .movie_sheet,
    .program .program_sheet_box .show_sheet,
    .program .program_sheet_box .event_sheet {display: none;}
    .program .program_btn .swiper-button-prev, .program .program_btn .swiper-button-next {display: none;}

    .program {
        height: auto;
        margin: 50px auto;
    }
    .program>div:first-child {
        height: 40px;
        line-height: 40px;
        text-align: center;
        font-size: 1.6rem;
    }
    .program .program_label {
        display: flex;
        justify-content: center;
        margin-bottom: 15px;
    }
    .program .program_label label {
        padding: 7px 12px;
        margin: 0 5px;
        background-color: white;
        border: 1px solid #ccc;
        box-sizing: border-box;
        border-radius: 20px;
    }
    .program .program_sheet_box {
        width: 100%;
        height: 410px;

        overflow: hidden;

        position: relative;
    }
    .program .program_sheet_box>section {
        width: 100%;
        height: 280px;
        background-color: #eee;
    }
    .program .program_sheet_box .movie_sheet,
    .program .program_sheet_box .show_sheet {
        width: 100%;
        height: 410px;

        position: relative;
    }
    .program .program_sheet_box .movie_sheet>section,
    .program .program_sheet_box .show_sheet>section {
        display: flex;
        width: 100%;
        height: 410px;
        justify-content: space-between;
    }
    .program .program_sheet_box .movie_sheet section .swiper-slide,
    .program .program_sheet_box .show_sheet section .swiper-slide {
        width: 50%;
        height: 410px;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:first-child,
    .program .program_sheet_box .show_sheet .swiper-slide>div:first-child {
        height: 50px;
        text-align: center;
        margin-top: 20px;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:first-child>a>p:first-child,
    .program .program_sheet_box .show_sheet .swiper-slide>div:first-child>a>p:first-child {
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:first-child>a>p:last-child,
    .program .program_sheet_box .show_sheet .swiper-slide>div:first-child>a>p:last-child {
        font-size: 1.2rem;
    }

    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2),
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2) {
        width: 100%;
        height: 350px;
        position: relative;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2)>div,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2)>div {
        position: absolute;
        top: 5px;
        right: 7px;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2)>img,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2)>img {
        width: 100%;
        height: 290px;
    }
    
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2) .poster_on,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2) .poster_on {
        position: relative;
        bottom: 0;
        left: 0;
        text-align: center;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2) .poster_on>a,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2) .poster_on>a {
        display: inline-block;
        padding: 5px 12px;
        border-radius: 20px;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2) .poster_on>a:first-child,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2) .poster_on>a:first-child {
        background-color: #2e3192;
        color: white;
    }
    .program .program_sheet_box .movie_sheet .swiper-slide>div:nth-child(2) .poster_on>a:last-child,
    .program .program_sheet_box .show_sheet .swiper-slide>div:nth-child(2) .poster_on>a:last-child {
        background-color: #eee;
        color: #333;
    }

    .program .program_sheet_box .event_sheet {
        width: 100%;
        height: 410px;

        position: relative;
    }
    .program .program_sheet_box .event_sheet>section {
        display: flex;
        justify-content: space-evenly;
        width: 100%;
        height: 410px;
    }
    .program .program_sheet_box .event_sheet>section>div {
        width: 50%;
        height: 410px;
    }
    .program .program_sheet_box .event_sheet>section>div:last-child {
        margin-left: 15px;
    }
    .program .program_sheet_box .event_sheet>section>div>div:first-child {
        height: 50px;
        text-align: center;
        margin-top: 20px;
    }
    .program .program_sheet_box .event_sheet>section>div>div:first-child>a>p:first-child {
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
    }
    .program .program_sheet_box .event_sheet>section>div>div:first-child>a>p:last-child {
        font-size: 1.2rem;
    }

    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2) {
        width: 100%;
        height: 350px;
        position: relative;
    }
    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2)>div {
        position: absolute;
        top: 5px;
        right: 7px;
    }
    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2)>img {
        width: 100%;
        height: 290px;
    }    

    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2) .poster_on{
        position: relative;
        bottom: 0;
        left: 0;
        text-align: center;
    }
    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2) .poster_on>a {
        display: inline-block;
        padding: 5px 12px;
        border-radius: 20px;
    }
    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2) .poster_on>a:first-child {
        background-color: #2e3192;
        color: white;
    }
    .program .program_sheet_box .event_sheet>section>div>div:nth-child(2) .poster_on>a:last-child {
        background-color: #eee;
        color: #333;
    }





    .critic {
        display: flex;
        flex-wrap: wrap;
        margin: 70px 15px;
    }
    .critic>p {
        width: 100%;
        height: 40px;
        line-height: 40px;
        text-align: center;
        font-size: 1.6rem;
    }
    .critic .txt {
        height: auto;
        padding: 15px 15px;
        overflow: hidden;
    }
    .critic .txt>p:nth-child(3) {
        display: -webkit-box;
        -webkit-line-clamp: 3;
        -webkit-box-orient: vertical;
        overflow: hidden;
    }
    .critic .critic_open {display: block;}
    .critic .critic_hide01 {display: none; margin: 15px 0;}
    .critic .critic_hide02 {display: none;}

    .critic .critic_open>div,
    .critic .critic_hide01>div,
    .critic .critic_hide02>div {
        width: 100%;
        border: 1px solid #ccc;
        box-sizing: border-box;
    }
    .critic .critic_open>div:first-child,
    .critic .critic_hide01>div:first-child,
    .critic .critic_hide02>div:first-child {
        margin-bottom: 15px;
    }
    .critic .critic_open>div>a,
    .critic .critic_hide01>div>a,
    .critic .critic_hide02>div>a {
        display: flex;
        width: 100%;
        box-shadow: 0 5px 5px gainsboro;
    }
    .critic .critic_open>div>a>div,
    .critic .critic_hide01>div>a>div,
    .critic .critic_hide02>div>a>div {
        width: 50%;
    }
    .critic .critic_open>div>a>div:first-child img,
    .critic .critic_hide01>div>a>div:first-child img,
    .critic .critic_hide02>div>a>div:first-child img {
        width: 100%
    }
    .critic .critic_open .txt p:nth-child(2),
    .critic .critic_hide01 .txt p:nth-child(2),
    .critic .critic_hide02 .txt p:nth-child(2) {
        padding: 5px 0;
    }

    .critic .critic_more_btn,
    .critic .critic_more_btn02 {
        width: 20%;
        height: 30px;
        line-height: 30px;
        text-align: center;
        border: 1px solid #ccc;
        border-radius: 20px;
        box-sizing: border-box;
        margin: 20px auto;
    }
    .critic .critic_more_btn02 {display: none;}

    .critic .critic_btn_box {display: none;}




    .event_banner_box {
        width: 100%;
        height: 140px;

        overflow: hidden;
    }
    .event_banner_box>div:first-child {display: none;}
    .event_banner_box .event_banner_btn {display: none;}
    .event_banner_box .event_banner {
        position: relative;
    }
    .event_banner_box .event_banner .event {
        width: 100%;
        height: 140px;
    }
    .event_banner_box .event_banner .event .swiper-slide {
        display: flex;
    }
    .event_banner_box .event_banner .event .swiper-slide {
        width: 80%;
        opacity: 1;
    }
    .event_banner_box .event_banner .event .swiper-slide>a {
        display: block;
        width: 100%;
        height: 140px;
    }
    .event_banner_box .event_banner .event .swiper-slide>a>img {
        display: block;
        width: 100%;
        height: 140px;
    }

    



    
    .sns_box {
        height: 840px;
        margin: 60px 15px;
    }
    .sns_box>p {height: 40px; line-height: 40px; text-align: center; font-size: 1.6rem;}
    .sns_box .sns {
        height: 800px;
        font-size: 1rem;
    }
    .sns_box .sns>section:first-child {
        display: flex;
        flex-wrap: wrap;
        height: 600px;
        box-sizing: border-box;
    }
    .sns_box .sns>section:first-child>div:first-child {
        width: 100%;
        height: 400px;
    }
    .sns_box .sns .sns_top_first_box {
        display: flex;
        box-sizing: border-box;
        height: 200px;
    }
    .sns_box .sns .sns_top_first_box>section:first-child {
        width: 60%;
        height: 200px;
    }
    .sns_box .sns .sns_top_first_box>section:first-child>a {
        display: block;
        width: 100%;
        height: 200px;
    }
