        flex-wrap: wrap;
        width: 40%;
        height: 450px;
        background-color: white;
    }
    .mapinfo_box .info_box>div {
        width: 100%;
        height: 217.5px;
        border: 1px solid #ccc;
        box-sizing: border-box;
    }
    .mapinfo_box .info_box>div:first-child {
        margin-bottom: 15px;
    }

    .mapinfo_box .info_box>div:last-child {margin-left: 0;}
    .mapinfo_box .info_box>div>p {
        height: 50px;
        line-height: 50px;
        padding: 0 20px;
        position: relative;
    }
    .mapinfo_box .info_box>div>p i {
        position: absolute;
        top: 20px;
        right: 20px;
    }

    .mapinfo_box .info_box .txt_box {
        width: 100%;
        margin-bottom: 5px;
    }
    .mapinfo_box .info_box .txt_box li {
        height: 35px;
        line-height: 35px;
    }
    .mapinfo_box .info_box .txt_box li a {
        position: relative;
        display:block;
    }
    .mapinfo_box .info_box .txt_box li a:hover {
        text-decoration: underline;
        text-decoration-color: #333;
    }
    .mapinfo_box .info_box .txt_box li a .title {
        display: block;
        text-overflow:ellipsis;
        overflow: hidden;
        white-space: nowrap;
        padding-left: 20px;
    }
    .mapinfo_box .info_box .txt_box li a .date {
        position: absolute;
        right: 20px;
        top: 0;
    }


    .service_box label {display: none;}

    .service_box {
        display: flex;
        width: 1360px;
        height: 120px;
        margin: 50px auto;
    }
    .service_box .info {
        display: flex;
        width: 330px;
        height: 120px;
    }
    .service_box .info>ul:first-child {
        width: 155px;
        height: 120px;
        text-align: left;
        border-right: 1px solid #eee;
        box-sizing: border-box;

        font-size: 1.4rem;
    }
    .service_box .info>ul:last-child {
        width: 175px;
        height: 120px;
        text-align: left;
        padding-left: 25px;

        font-size: 1.4rem;
    }
    .service_box .info>ul>li {
        height: 30px;
        line-height: 30px;
    }

    .service_box .agency {
        display: flex;
        flex-wrap: wrap;
        justify-content: space-evenly;
        width: 700px;
        height: 120px;
        border-left: 1px solid #eee;
        box-sizing: border-box;
    }
    .service_box .agency>div {
        width: 100%;
        height: 60px;
        padding: 0 20px;
    }
    .service_box .agency>div:first-child {
        margin-top: 10px;
    }

    .service_box .agency .relevant_box {
        display: flex;
        height: 40px;
        position: relative;
    }

    .service_box .agency .relevant_box>p {
        width: 30%;
        height: 40px;
        line-height: 40px;
        padding-left: 30px;
    }
    .service_box .agency .relevant_box>p i {
        width: 18px;
        height: 18px;
        line-height: 18px;
        text-align: center;
        font-size: 1.4rem;
        border: 1px solid #ccc;
        box-sizing: border-box;
        margin-left: 5px;
        color: #666;
    }

    .service_box .agency .relevant_box .relevant {
        width: 70%;
        height: 40px;
        position: relative;
        overflow: hidden;
    }
    .service_box .agency .relevant_box .relevant>ul {
        display: flex;
        width: 1000%;
        height: 40px;
        position: absolute;
        top: 0;
        left: 0;
    }
    .service_box .agency .relevant_box .relevant>ul>li {
        display: flex;
        width: 100%;
        height: 40px;
        font-size: 2rem;
        box-sizing: border-box;
    }
    .service_box .agency .relevant_box .relevant>ul>li>div>a {
        display: block;
        width: 100%;
        height: 40px;
    }
    .service_box .agency .relevant_box .relevant>ul>li>div>a>img {
        width: 100%;
        height: 40px;
    }


    .service_box .agency .mesena_box {
        display: flex;
        height: 40px;
        position: relative;
    }
    .service_box .agency .mesena_box>p {
        width: 30%;
        height: 40px;
        line-height: 40px;
        padding-left: 30px;
    }
    .service_box .agency .mesena_box>p i {
        width: 18px;
        height: 18px;
        line-height: 18px;
        text-align: center;
        font-size: 1.4rem;
        border: 1px solid #ccc;
        box-sizing: border-box;
        margin-left: 5px;
        color: #666;
    }
    .service_box .agency .mesena_box .mesena {
        width: 70%;
        height: 40px;
        position: relative;
        overflow: hidden;
    }
    .service_box .agency .mesena_box .mesena>ul {
        display: flex;
        width: 200%;
        height: 40px;
        position: absolute;
        top: 0;
        left: 0;
    }
    .service_box .agency .mesena_box .mesena>ul>li {
        display: flex;
        justify-content: center;
        width: 100%;
        height: 40px;
        font-size: 2rem;
    }
    .service_box .agency .mesena_box .mesena>ul>li>div:first-child {
        width: 50%;
        height: 40px;
    }
    .service_box .agency .mesena_box .mesena>ul>li>div:last-child {
        width: 50%;
        height: 40px;
    }
    .service_box .agency .mesena_box .mesena>ul>li>div>a {
        display: block;
        width: 100%;
        height: 40px;
    }
    .service_box .agency .mesena_box .mesena>ul>li>div>a>img {
        width: 100%;
        height: 40px;
    }
    

    .service_box .letter {
        width: 330px;
        height: 120px;
        border-left: 1px solid #eee;
        box-sizing: border-box;
        text-align: center;
    }
    .service_box .letter>p {
        padding-top: 20px;
    }
    .service_box .letter>a {
        display: block;
        width: 150px;
        height: 40px;
        line-height: 40px;
        color: white;
        margin-top: 20px;
        background-color: #2e3192;
        border-radius: 20px;
        margin: 10px auto;
    }





    .footer {
        width: 100%;
        height: 300px;
        background-color: #eee;
    }
    .footer>div {
        width: 1360px;
        height: 300px;
        margin: 0 auto;
    }
    .footer>div>div:first-child {
        width: 100%;
        text-align: center;
        padding: 40px;
        color: #666;
    }
    .footer>div>div:first-child>p:nth-child(3)>span>a {
        display: inline-block;
        padding: 0 7px;
        border: 1px solid #ccc;
        box-sizing: border-box;
        background-color: white;
        border-radius: 5px;
        font-size: 1.4rem;
    }
    .footer>div>div:last-child {
        display: flex;
        width: 600px;
        height: 50px;
        margin: 0 auto;
    }
    .footer>div>div:last-child>div:first-child {
        width: 300px;
        height: 80px;
    }
    .footer>div>div:last-child>div:last-child {
        width: 300px;
        height: 50px;
        margin-left: 15px;
    }
    .footer>div>div:last-child>div:first-child>img {
        width: 300px;
        height: 80px;
    }
    .footer>div>div:last-child>div:last-child>img {
        width: 300px;
        height: 50px;
    }





    .move_btn {
        position: fixed;
        bottom: 20px;
        right: 110px;
        cursor: pointer;

        z-index: 6;
    }
    .move_btn .wish_list {
        width: 55px;
        height: 55px;
        border-radius: 30px;
        box-sizing: border-box;
        background-color: white;
        border: 1px solid #ccc;
        color: #333;
        text-align: center;
        padding-top: 10px;
        margin-bottom: 7px;
        font-size: 1.2rem;
    }
    .move_btn .speed_reservation>a {
        display: block;
        width: 55px;
        height: 55px;
        border-radius: 30px;
        box-sizing: border-box;
        background-color: #2e3192;
        color: white;
        text-align: center;
        padding-top: 10px;
        margin-bottom: 7px;
        font-size: 1.2rem;
        font-weight: lighter;
        opacity: 1;

        animation-name: resev_color;
        animation-duration: 10s;
        animation-iteration-count: infinite;
    }
    @keyframes resev_color {
        0% {background-color: green}
        10% {background-color: #2e3192}
        30% {background-color: darkcyan}
        70% {background-color: darkblue;}
        80% {background-color: darksalmon;}
        100% {background-color: green;}
    }
    .move_btn .top_btn {
        width: 55px;
        height: 55px;
        border-radius: 30px;
        border: 1px solid #ccc;
        box-sizing: border-box;
        background-color: white;
        text-align: center;
        line-height: 55px;
        margin-bottom: 7px;
        display: none;
    }
    .move_btn .bottom_btn {
        width: 55px;
        height: 55px;
        border-radius: 30px;
        border: 1px solid #ccc;
        box-sizing: border-box;
        background-color: white;
        text-align: center;
        line-height: 55px;
        display: none;
    }

}
